import React from 'react';

const Home = () => {
    return (<>
        <div className="container">
            <div className="backgroundHeader">
                <img src="../assets/SCMMA_logo_brush.svg" alt="Saint Charles MMA Logo" />
            </div>
            <h1>HOMEPAGE</h1>
            <div style={{ "height": "2000px" }}></div>
        </div>
    </>);
}

export default Home;
